import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import "./DisplayExpenses.css";
import ExpensesFilter from "../ExpensesFilter/ExpensesFilter";
import  {useState} from "react"
const DisplayExpenses = (props) => {
    const selectedYearHandle = (expectedYear) => {
    console.log("Received Year from filter");
    console.log(expectedYear);
  };

  return (
    <Card className="expenses">
      <ExpensesFilter onSelectYear={selectedYearHandle} />
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
      <ExpenseItem
        title={props[1].title}
        amount={props[1].amount}
        date={props[1].date}
      />
      <ExpenseItem
        title={props[2].title}
        amount={props[2].amount}
        date={props[2].date}
      />
      <ExpenseItem
        title={props[3].title}
        amount={props[3].amount}
        date={props[3].date}
      />
    </Card>
  );
};

export default DisplayExpenses;
